In this example, the `jest.mock()` function is used to mock the `MyComponent` component with a function that returns a simple div element with the text "Mocked MyComponent". This allows us to test the component without having to actually render it.

You can also use the `jest.spyOn()` function to mock individual methods of a React component. This can be useful for testing components that have complex interactions with other parts of your application.

For example, the following code shows how to mock the `MyComponent` component's `handleClick()` method:

