To do this, we can use a technique called dynamic programming. Since we're dealing with two different games (Suma-10 and Suma-S), we'll need to create two separate functions to keep track of the number of moves needed for each game.

Let's define a function `suma_10(A)` that takes the initial list A for Suma-10 and returns the minimum number of moves needed to remove all the numbers from the list.

We'll also define a function `suma_s(A, S)` that takes the initial list A and the integer S for Suma-S, and returns the minimum number of moves needed to remove all the numbers from the list.

Here's the Python code to implement these functions:
```python
def suma_10(A):
    n = len(A)
    dp = [[0]] * n

    for i in range(n):
        for j in range(i + 1, n):
            if A[i] == A[j] or (i + j) % 2 == 0:
                dp[i][0] = min(dp[i][0], dp[i - 1][j - 1] + 1)
            else:
                dp[i][0] = min(dp[i][0], dp[i - 1][j] + 1)

    return dp[n - 1][0]

def suma_s(A, S):
    n = len(A)
    dp = [[0]] * n

    for i in range(n):
        for j in range(i + 1, n):
            if A[i] == A[j] or (i + j) % 2 == 0:
                dp[i][0] = min(dp[i][0], dp[i - 1][j - 1] + 1)
            elif A[i] + A[j] == S:
                dp[i][0] = min(dp[i][0], dp[i - 1][j] + 1)
            else:
                dp[i][0] = min(dp[i][0], dp[i - 1][j - 1] + 1)

    return dp[n - 1][0]

